import React from "react";

export default function FaheemDancer() {
  return (
    <div>
      <div className="mb-3">
        <label for="exampleFormControlTextarea1" className="form-label">
          Apna Masla Bataaein
        </label>
        <textarea
          className="form-control"
          id="exampleFormControlTextarea1"
          rows="3"
        ></textarea>
      </div>
    </div>
  );
}
